('hairy-sloth', '44', 'THE SUM OF TWO NUMBERS IS 27 AND PRODUCT IS 182 , WHAT ARE THE TWO\n NUMBERS?\nಎರಡು ಸಂಖ್ಯೆಗಳ ಮೊತ್ತವು 27 ಮತ್ತು ಉತ್ಪನ್ನವು 182 ಆಗಿದೆ, ಎರಡು ಸಂಖ್ಯೆಗಳು ಯಾವುವು?', '12 AND 13\n12 ಮತ್ತು 13 ', '13 AND 14\n13 ಮತ್ತು 14', '12 AND 15\n12 ಮತ್ತು 15', '13 AND 24\n13 ಮತ್ತು 24', 'B', 1, ''),
('hairy-sloth', '45', 'D ಮತ್ತು E ಗಳು ಕ್ರಮವಾಗಿ ABCಯ ತ್ರಿಕೋನದ AB ಮತ್ತು AC ನ ಮಧ್ಯಬಿಂದುಗಳಾಗಿವೆ ಮತ್ತು\n BC=6CM. DE BC ಗೆ ಸಮಾನಾಂತರವಾಗಿದ್ದರೆ DE ಯ ಸೆಂಟಿಮೀಟರ್‌ನಲ್ಲಿನ ಉದ್ದವು:\nD AND E ARE MIDPOINTS OF SIDE AB AND AC OF A TRIANGLE ABC RESPECTIVELY\n AND BC=6CM.IF DE PARALLEL TO BC THEN THE LENGTH IN CENTIMETRE OF DE\n IS :\n', '2.5', '3', '5', '6.', 'B', 1, ''),
('hairy-sloth', '46', 'IF THE DISTANCE BETWEEN THE POINTS A(2,- 2) AND B(-1,X)IS EQUALS TO 5 \n,THEN THE VALUE OF X IS:\nA(2,- 2) ಮತ್ತು B(-1,X) ಬಿಂದುಗಳ ನಡುವಿನ ಅಂತರವು 5 ಕ್ಕೆ ಸಮನಾಗಿದ್ದರೆ, X ನ ಮೌಲ್ಯವು:\n', '2', '-2', '1', '-1', 'A', 1, ''),
('hairy-sloth', '47', 'IN RIGHT ANGLED TRIANGLE ABC ,RIGHT-ANGLED AT B ,AB = 24 CM ,BC=7 CM,\n THE VALUE OF TANC IS?\nಲಂಬಕೋನ ತ್ರಿಕೋನದಲ್ಲಿ ABC , B ನಲ್ಲಿ ಬಲ-ಕೋನ ,AB = 24 CM ,BC=7 CM, ಟ್ಯಾನ್C ಯ \nಮೌಲ್ಯ?', '12/7\n', '24/7\n', '20/7', '7/20', 'B', 1, ''),
('hairy-sloth', '48', 'CIRCLE HAS HOW MANY NUMBER OF TANGENTS ?\nವೃತ್ತವು ಎಷ್ಟು ಸಂಖ್ಯೆಯ ಸ್ಪರ್ಶಕಗಳನ್ನು ಹೊಂದಿದೆ?', '0', '1', '2', 'ಅನಂತ\nINFINITY\n', 'D', 1, ''),
('hairy-sloth', '49', 'ಟ್ಯಾನ್ 60°/ ಕಾಟ್ 30° ಯಾವ ಮೌಲ್ಯಕ್ಕೆ ಸಮಾನವಾಗಿರುತ್ತದೆ?\nFOR WHAT VALUE OF TAN 60°/ COT 30° IS EQUALS TO?', '1', '2', '3', '0', 'A', 1, ''),
('hairy-sloth', '50', 'THE PROBABILITY OF EVENT EQUAL TO ZERO IS CALLED AS?\nಶೂನ್ಯಕ್ಕೆ ಸಮನಾದ ಘಟನೆಯ ಸಂಭವನೀಯತೆಯನ್ನು ಹೀಗೆ ಕರೆಯುತ್ತಾರೆ?', 'UNSURE EVENT \nಅನಿಶ್ಚಿತ ಘಟನೆ', 'SURE EVENT\nಖಚಿತವಾದ ಘಟನೆ', 'IMPOSSIBLE EVENT\nಅಸಾಧ್ಯ ಘಟನೆ', 'INDEPENDENT EVENT\nಸ್ವತಂತ್ರ ಘಟನೆ', 'C', 1, ''),
('hairy-sloth', '51', 'WHAT HAPPENS WHEN DILUTE HYDROCHLORIC ACID IS ADDED TO IRON POWDER? \nದುರ್ಬಲಗೊಳಿಸಿದ ಹೈಡ್ರೋಕ್ಲೋರಿಕ್ ಆಮ್ಲವನ್ನು ಕಬ್ಬಿಣದ ಪುಡಿಗೆ ಸೇರಿಸಿದಾಗ ಏನಾಗುತ್ತದೆ? ', 'HYDROGEN GAS AND IRON CHLORIDE ARE PRODUCED.\nಹೈಡ್ರೋಜನ್ ಅನಿಲ ಮತ್ತು ಕಬ್ಬಿಣದ ಕ್ಲೋರೈಡ್ ಉತ್ಪತ್ತಿಯಾಗುತ್ತದೆ. \n', 'CHLORINE GAS AND IRON HYDROXIDE ARE PRODUCED.\nಕ್ಲೋರಿನ್ ಅನಿಲ ಮತ್ತು ಕಬ್ಬಿಣದ ಹೈಡ್ರಾಕ್ಸೈಡ್ ಉತ್ಪತ್ತಿಯಾಗುತ್ತದೆ.\n', 'NO REACTION TAKES PLACE.\nಯಾವುದೇ ಪ್ರತಿಕ್ರಿಯೆ ನಡೆಯುವುದಿಲ್ಲ', 'IRON SALT AND WATER ARE PRODUCED\nಕಬ್ಬಿಣದ ಉಪ್ಪು ಮತ್ತು ನೀರನ್ನು ಉತ್ಪಾದಿಸಲಾಗುತ್ತದೆ', 'A', 1, ''),
('hairy-sloth', '52', 'A SOLUTION TURNS RED LITMUS BLUE, ITS PH IS LIKELY TO BE\nದ್ರಾವಣವು ಕೆಂಪು ಲಿಟ್ಮಸ್ ನೀಲಿ ಬಣ್ಣಕ್ಕೆ ತಿರುಗುತ್ತದೆ, ಅದರ PH ಆಗಿರಬಹುದು', '1 ', '4', '5', '10\n', 'D', 1, ''),
