('hairy-sloth', '60', 'WHEN WE PRESS THE BULB OF A DROPPER WITH ITS NOZZLE KEPT IN WATER, AIR IN THE DROPPER IS SEEN TO ESCAPE IN THE FORM OF BUBBLES. ONCE WE RELEASE THE PRESSURE ON THE BULB, WATER GETS FILLED IN THE DROPPER. THE RISE OF WATER IN THE DROPPER IS DUE TO \nನಾವು ಡ್ರಾಪ್ಪರ್‌ನ ಬಲ್ಬ್ ಅನ್ನು ಅದರ ನಳಿಕೆಯನ್ನು ನೀರಿನಲ್ಲಿ ಇರಿಸಿದಾಗ, ಡ್ರಾಪ್ಪರ್‌ನಲ್ಲಿರುವ ಗಾಳಿಯು ಗುಳ್ಳೆಗಳ ರೂಪದಲ್ಲಿ ಹೊರಹೋಗುವಂತೆ ಕಾಣುತ್ತದೆ. ಒಮ್ಮೆ ನಾವು ಬಲ್ಬ್ ಮೇಲೆ ಒತ್ತಡವನ್ನು ಬಿಡುಗಡೆ ಮಾಡಿದರೆ, ಡ್ರಾಪ್ಪರ್ನಲ್ಲಿ ನೀರು ತುಂಬುತ್ತದೆ. ಡ್ರಾಪ್ಪರ್ನಲ್ಲಿ ನೀರಿನ ಏರಿಕೆ ಕಾರಣ', 'PRESSURE OF WATER \nನೀರಿನ ಒತ್ತಡ', 'GRAVITY OF THE EARTH \nಭೂಮಿಯ ಗುರುತ್ವಾಕರ್ಷಣೆ', 'SHAPE OF RUBBER BULB \nರಬ್ಬರ್ ಬಲ್ಬ್ನ ಆಕಾರ', 'ATMOSPHERIC PRESSURE \nವಾತಾವರಣದ ಒತ್ತಡ', 'D', 1, ''),
