('amaranth-frigatebird', '47', 'ANTIBIOTICS ARE NOT EFFECTIVE AGAINST\nಪ್ರತಿ ಜೈವಿಕಗಳು ಯಾವುದರ ವಿರುದ್ಧ ಪರಿಣಾಮ ಕಾರಿಯಾಗಿರುವುದಿಲ್ಲ. ', 'BACTERIA \nಬ್ಯಾಕ್ಟೀರಿಯ', 'VIRUS\nವೈರಸ್', 'PROTOZOA\nಪ್ರೋಟಜೋವಾ', 'FUNGI \nಶಿಲೀಂದ್ರ', 'B', 1, ''),
