('amaranth-frigatebird', '49', 'WHICH PHYLUM CONTAINS THE GREATEST NUMBER OF SPECIES OF ANIMALS?\nಯಾವ ಫೈಲಮ್ ಪ್ರಾಣಿಗಳ ದೊಡ್ಡ ಸಂಖ್ಯೆಯ ಜಾತಿಗಳನ್ನು ಒಳಗೊಂಡಿದೆ?', 'PORIFERA \nಸ್ಪಂಜುಗಳು', 'NEMATODA \nನೆಮಟೋಡಾ', 'COELENTERATE \nಕುಟುಕು ಕಣವಂತ', 'ARTHROPODA\nಶೀಲ್ಗಾಲಿಗಳು', 'D', 1, ''),
('amaranth-frigatebird', '50', 'FEMALE ANAPHELES MOSQUITOES WILL SPREAD THE DISEASE\nಹೆಣ್ಣು ಅನಾಫಿಲೀಸ್ ಸೊಳ್ಳೆಯಿಂದ ಬರುವ ರೋಗ', 'TUBERCULOSIS \nಕ್ಷಯ', 'CHOLERA \nಕಾಲರಾ', 'MALERIA \nಮಲೇರಿಯಾ', 'CORONA \nಕೊರೋನ', 'C', 1, ''),
