('enthusiastic-panda', '21', 'ವಿಜ್ಞಾನ ಪದದ ತದ್ಭವ ರೂಪ______________', 'ಬಿನ್ನಾಣ', 'ಬಿನ್ನಣ', 'ವಿಸ್ನಾನ ', 'ಬಿಜ್ಞಾನ', 'B', 1, ''),
('enthusiastic-panda', '22', 'ಶಿವರಾಂ ಕಾರಂತರರಿಗೆ ಜ್ಞಾನಪೀಠ ಪ್ರಶಸ್ತಿ ತಂದುಕೊಟ್ಟ ಪುಸ್ತಕ______________', 'ಮೂಕಜ್ಜಿಯ ಕನಸುಗಳು', 'ಚಿಕ್ಕವೀರರಾಜೇಂದ್ರ \n', 'ಭಾರತ ಸಿಂಧೂರ ರಶ್ಮಿ \n', 'ಹುಚ್ಚು ಮನಸ್ಸಿನ ಹತ್ತು ಮುಖಗಳು\n', 'A', 1, ''),
('enthusiastic-panda', '23', ' “ಸ್ವಾತಂತ್ರ್ಯ ನಮ್ಮ ಆಜನ್ಮ ಸಿದ್ದ ಹಕ್ಕು” ಈ ಹೇಳಿಕೆಯಲ್ಲಿ ಇರುವ ಲೇಖನ ಚಿಹ್ನೆಯನ್ನು ತಿಳಿಸಿ___________\n', 'ವಾಕ್ಯ ವೇಷ್ಟನ ಚಿಹ್ನೆ\n', 'ವಿವರಣಾತ್ಮಕ ಚಿಹ್ನೆ \n', 'ಉದ್ಧರಣ ಚಿಹ್ನೆ \n', 'ವಿವರಣ ವಿರಾಮ ಚಿಹ್ನೆ\n', 'C', 1, ''),
