('enthusiastic-panda', '36', ' “ಅವನು ನಾಳೆ ಹಾಡು ಹೇಳುತ್ತಾನೆ”ಈ ಹೇಳಿಕೆಯಲ್ಲಿರುವ ಕ್ರಿಯಾಪದದ ರೂಪ\n\n', 'ಸಂಭವನಾರ್ಥಕ ಕ್ರಿಯಾಪದ\n', 'ವಿಧ್ಯರ್ಥಕ ಕ್ರಿಯಾಪದ \n', 'ನಿಷೇಧಾರ್ಥಕ ಕ್ರಿಯಾಪದ', 'ಸಾಮಾನ್ಯಾರ್ಥಕ ಕ್ರಿಯಾಪದ\n', 'B', 1, ''),
('enthusiastic-panda', '37', 'ಕುಲಾಲದ ಚಕ್ರ ಎಂದರೆ\n', 'ಸಮಯ ನೋಡಲು ಬಳಸುವ ಸಾಧನ ಚಕ್ರ \n', 'ಪ್ರಾಣಿಯ ಬಂಡಿಗಳಿಗೆ ಬಳಸುವ ಸಾಧನ ಚಕ್ರ\n', 'ಮಕ್ಕಳು ಆಟ ಆಡಲು ಬಳಸುವ ಸಾಧನ ಚಕ್ರ\n', 'ಮಡಕೆ ಮಾಡಲು ಕುಂಬಾರರು ಬಳಸುವ ಸಾಧನ ಚಕ್ರ\n', 'D', 1, ''),
('enthusiastic-panda', '38', 'ಅವನೇ ಎಂಬ ಪದವು ಅವ್ಯಯದ ಈ ವಿವಿಧ\n', 'ಭಾವ ಸೂಚಕ ಅವ್ಯಯ\n', 'ಅವಧರಣಾರ್ಥಕವ್ಯಯ\n', 'ಸಾಮಾನ್ಯಾರ್ಥಕವ್ಯಯ\n', 'ಸಂಬಂಧಾರ್ಥಕವ್ಯಯ\n', 'B', 1, ''),
('enthusiastic-panda', '39', 'ವಿಕ್ರಮಾರ್ಜುನ ವಿಜಯ ಕೃತಿಯ ಕರ್ತೃ\n', 'ರನ್ನ \n', 'ಪಂಪ\n', 'ಪೊನ್ನ \n', 'ಜನ್ನ\n', 'B', 1, ''),
('enthusiastic-panda', '40', 'ಉಪಮಾಲೋಲ ಎಂದು ಬಿರುದಾಂಕಿತನಾದ ಕವಿ\n', 'ಷಡಕ್ಷರಿ\n', 'ನಾಗವರ್ಮ\n', 'ಲಕ್ಷ್ಮೀಶ\n', 'ಕುಮಾರವ್ಯಾಸ\n', 'C', 1, ''),
('enthusiastic-panda', '41', 'A BOAT TAKES 2HR TO TRAVEL 8KM AND BACK IN STILL WATER LAKE WITH WATER VELOCITY OF 4KM/HR ,THEN THE TIME TAKEN FOR GOING UPSTREAM OF 8KM AND COMING BACK IS:\nದೋಣಿಯು 8 ಕಿಮೀ ಪ್ರಯಾಣಿಸಲು 2 ಗಂಟೆ ತೆಗೆದುಕೊಳ್ಳುತ್ತದೆ ಮತ್ತು 4 ಕಿಮೀ ನೀರಿನ ವೇಗದೊಂದಿಗೆ ಸ್ಥಿರ ನೀರಿನ ಸರೋವರದಲ್ಲಿ ಹಿಂತಿರುಗುತ್ತದೆ, ನಂತರ 8 ಕಿಮೀ ಎತ್ತರಕ್ಕೆ ಹೋಗಿ ಹಿಂತಿರುಗಲು ತೆಗೆದುಕೊಳ್ಳುವ ಸಮಯ:', '120 MIN', '160 MIN', '200MIN', 'NONE OF THESE.', 'B', 1, ''),
('enthusiastic-panda', '42', 'NAME THE MIRROR HAVING REFLECTION SURFACE CURVED OUTWARD.\nಪ್ರತಿಫಲನಮೇಲ್ಮೈ ಹೊರಕ್ಕೆ ಬಾಗಿದ ಕನ್ನಡಿಯನ್ನು ಹೆಸರಿಸಿ.', 'PLANE MIRROR\nಸಮತಲ ಕನ್ನಡಿ ', 'CONCAVE MIRROR\nಕಾನ್ಕೇವ್ ಕನ್ನಡಿ', 'CONVEX MIRROR\nಪೀನ ಕನ್ನಡಿ', 'CYLINDRICAL MIRROR.\nಸಿಲಿಂಡರಾಕಾರದ ಕನ್ನಡಿ.', 'C', 1, ''),
('enthusiastic-panda', '43', 'ON WHAT DOES A TOY CAR RELEASED WITH THE SAME INITIAL SPEED WILL TRAVEL FARTHEST ON\nಅದೇ ಆರಂಭಿಕ ವೇಗದಲ್ಲಿ ಬಿಡುಗಡೆಯಾದ ಆಟಿಕೆ ಕಾರು ಯಾವುದರ ಮೇಲೆ ಹೆಚ್ಚು ದೂರ ಪ್ರಯಾಣಿಸುತ್ತದೆ ', 'MUDDY SURFACE\nಮಣ್ಣಿನ ಮೇಲ್ಮೈ', 'POLISHED MARBEL SURFACE\nನಯಗೊಳಿಸಿದ ಮಾರ್ಬಲ್ ಮೇಲ್ಮೈ', 'CEMENTED SURFACE\nಸಿಮೆಂಟ್ ಮೇಲ್ಮೈ', 'BRICK SURFACE\nಇಟ್ಟಿಗೆ ಮೇಲ್ಮೈ\n', 'B', 1, ''),
('enthusiastic-panda', '44', 'WHICH OF THE BELOW DETERMINES THE LOUDNESS OF SOUND\nಕೆಳಗಿನವುಗಳಲ್ಲಿ ಯಾವುದು ಧ್ವನಿಯ ಲೌಡ್‌ನೆಸ್ ಅನ್ನು ನಿರ್ಧರಿಸುತ್ತದೆ', 'AMPLITUDE OF VIBRATION\nಕಂಪನದ ವೈಶಾಲ್ಯ', 'RATIO OF AMPLITUDE AND FREQUENCY OF VIBRATION\nಕಂಪನದ ವೈಶಾಲ್ಯ ಮತ್ತು ಆವರ್ತನದ ಅನುಪಾತ', 'FREQUENCY OF VIBRATION\nಕಂಪನದ ಆವರ್ತನ', 'PRODUCT OF AMPLITUDE AND FREQUENCY OF VIBRATION \nಕಂಪನದ ವೈಶಾಲ್ಯ ಮತ್ತು ಆವರ್ತನದ ಉತ್ಪನ್ನ', 'A', 1, ''),
('enthusiastic-panda', '45', 'A FUSE WIRE IS INSERTED TO WHICH OF THE FOLLOWING WIRE?\nಕೆಳಗಿನ ಯಾವ ತಂತಿಗೆ ಫ್ಯೂಸ್ತಂತಿಯನ್ನು ಸೇರಿಸಲಾಗುತ್ತದೆ? ', 'LIVE WIRE\nಸಜೀವ ತಂತಿ', 'NEUTRAL WIRE\nತಟಸ್ಥ ತಂತಿ', 'EARTH WIRE\nಭೂಮಿಯ ತಂತಿ', 'MAY BE CONNECTED TO ANY WIRE.\nಯಾವುದೇ ತಂತಿಗೆ ಸಂಪರ್ಕಿಸಬಹುದು.', 'A', 1, ''),
('enthusiastic-panda', '46', 'FOR WHICH OF THE BELOW DOES NEWTONS LAW OF GRAVITATION APPLIES TO\nಈ ಕೆಳಗಿನ ಯಾವುದಕ್ಕೆ ನ್ಯೂಟನ್ಸ್ ಗುರುತ್ವಾಕರ್ಷಣೆಯ ನಿಯಮ ಅನ್ವಯಿಸುತ್ತದೆ', 'SMALL BODIES ONLY\nಸಣ್ಣ ದೇಹಗಳು ಮಾತ್ರ', 'ಗ್ರಹಗಳು ಮಾತ್ರ\nPLANETS ONLY', 'ಅವುಗಳ ಗಾತ್ರವನ್ನು ಲೆಕ್ಕಿಸದೆ ಎಲ್ಲಾ ದೇಹ\nALL THE BODY IRRESPECTIVE OF THEIR SIZE', 'ಸೌರವ್ಯೂಹಕ್ಕಾಗಿ.\nFOR SOLAR SYSTEM.\n', 'C', 1, ''),
('enthusiastic-panda', '47', 'ANTIBIOTICS ARE NOT EFFECTIVE AGAINST\nಪ್ರತಿ ಜೈವಿಕಗಳು ಯಾವುದರ ವಿರುದ್ಧ ಪರಿಣಾಮ ಕಾರಿಯಾಗಿರುವುದಿಲ್ಲ. ', 'BACTERIA \nಬ್ಯಾಕ್ಟೀರಿಯ', 'VIRUS\nವೈರಸ್', 'PROTOZOA\nಪ್ರೋಟಜೋವಾ', 'FUNGI \nಶಿಲೀಂದ್ರ', 'B', 1, ''),
('enthusiastic-panda', '48', 'FOOD RICH IN ROUGHAGES    \nನಾರಿನಂಶವುಳ್ಳ ಆಹಾರ ಪದಾರ್ಥಗಳು  ', 'FRIDE FOOD \nಕರಿದ ಪದಾರ್ಥಗಳು', 'PULSES \nಬೇಳೆ ಕಾಳುಗಳು', 'NOODLES \nನೂಡಲ್ಸ್', 'FRUITS AND VEGETABLES \nಹಣ್ಣು ಮತ್ತು ತರಕಾರಿಗಳು', 'D', 1, ''),
('enthusiastic-panda', '49', 'WHICH PHYLUM CONTAINS THE GREATEST NUMBER OF SPECIES OF ANIMALS?\nಯಾವ ಫೈಲಮ್ ಪ್ರಾಣಿಗಳ ದೊಡ್ಡ ಸಂಖ್ಯೆಯ ಜಾತಿಗಳನ್ನು ಒಳಗೊಂಡಿದೆ?', 'PORIFERA \nಸ್ಪಂಜುಗಳು', 'NEMATODA \nನೆಮಟೋಡಾ', 'COELENTERATE \nಕುಟುಕು ಕಣವಂತ', 'ARTHROPODA\nಶೀಲ್ಗಾಲಿಗಳು', 'D', 1, ''),
('enthusiastic-panda', '50', 'FEMALE ANAPHELES MOSQUITOES WILL SPREAD THE DISEASE\nಹೆಣ್ಣು ಅನಾಫಿಲೀಸ್ ಸೊಳ್ಳೆಯಿಂದ ಬರುವ ರೋಗ', 'TUBERCULOSIS \nಕ್ಷಯ', 'CHOLERA \nಕಾಲರಾ', 'MALERIA \nಮಲೇರಿಯಾ', 'CORONA \nಕೊರೋನ', 'C', 1, ''),
