('delicate-spider', '53', 'THE COMPONENT OF FOOD THAT DOES NOT PROVIDE ANY NUTRIENT TO OUR BODY AND YET IS ESSENTIAL IN OUR FOOD IS\nನಮ್ಮ ದೇಹಕ್ಕೆ ಯಾವುದೇ ಪೋಷಕಾಂಶವನ್ನು ಒದಗಿಸದ  ಆಹಾರದ ಈ ಅಂಶವು ನಮ್ಮ ಆಹಾರದಲ್ಲಿ ಅತ್ಯಗತ್ಯವಾಗಿರುತ್ತದೆ', 'FAT\nಕೊಬ್ಬು', 'CARBOHYDRATE\nಶರ್ಕರಪಿಷ್ಟಗಳು', 'VITAMIN\nವಿಟಮಿನ್', 'ROUGHAGE\nನಾರಿನಂಶ', 'D', 1, ''),
('delicate-spider', '54', 'THE THREE R\'S THAT WILL HELP US TO CONSERVE NATURAL RESOURCES FOR LONG TERM USE ARE\nನೈಸರ್ಗಿಕ ಸಂಪನ್ಮೂಲಗಳನ್ನು ಸಂರಕ್ಷಿಸಲು ನಮಗೆ ಸಹಾಯ ಮಾಡುವ ಮೂರು R\'ಗಳು ', 'RECYCLE, REGENERATE, REUSE \nಮರುಬಳಕೆ, ಪುನರುತ್ಪಾದನೆ, ಮರುಬಳಕೆ', 'REDUCE, REGENERATE, REUSE\nಕಡಿಮೆಗೊಳಿಸು, ಪುನರುತ್ಪಾದನೆ, ಮರುಬಳಕೆ', 'REDUCE, REUSE, REDISTRIBUTE\nಕಡಿಮೆಗೊಳಿಸು,ಮರುಬಳಕೆ, ಮರುಹಂಚಿಕೆ', 'REDUCE, RECYCLE, REUSE\nಕಡಿಮೆಗೊಳಿಸು, ಮರುಬಳಕೆ, ಮರಳಿ ಉಪಯೋಗಿಸು', 'D', 1, ''),
('delicate-spider', '55', 'CHEMICAL COMPOSITION OF RUST IS\nತುಕ್ಕು ಇದರ ರಾಸಾಯನಿಕ ಸೂತ್ರ', 'FE203\n', 'FE2 0 3. 3 H20\n', 'FE 2 0 3+2FE (OH)3\n', 'FE 20 4\n', 'B', 1, ''),
('delicate-spider', '56', 'CHOOSE THE CORRECT STATEMENT ABOUT ACIDS AND BASES\nದ್ರವನದ ಆಮ್ಲಿಯತೆ ಮತ್ತು ಪ್ರತ್ಯಾಮ್ಲಿಯತೆಗೆ ಸಂಬಂಧಿಸಿದಂತೆ ಈ ಕೆಳಗಿನವುಗಳಲ್ಲಿ ಸರಿಯಾದ ಹೇಳಿಕೆ\nA.  HIGHER THE PH, STRONGER THE ACID (ಹೆಚ್ಚಿನ PH, ಸಾರಯುತ ಅಮ್ಲ)\nB. HIGHER THE PH, WEAKER THE ACID (ಹೆಚ್ಚಿನ PH, ಸಾರರಿಕ್ತ ಅಮ್ಲ)\nC. LOWER THE PH WEAKER THE BASE (ಕಡಿಮೆ PH, ಸರರಿಕ್ತ ಪ್ರತ್ಯಾಮ್ಲ)\nD. LOWER THE PH STRONGER THE BASE (ಕಡಿಮೆ PH, ಸಾರಯುತ ಪ್ರತ್ಯಾಮ್ಲ)', '(A) & (B)', '(B) & (C)', '(A) & (C)', '(B) & (C)', 'B', 1, ''),
('delicate-spider', '57', 'EXAMPLE FOR METAL \nಲೋಹಗಳಿಗೆ ಒಂದು ಉದಾಹರಣೆ', 'LITHIUM\nಲಿಥಿಯಂ', 'IODINE\nಅಯೋಡಿನ್', 'GERMENIUM\nಜರ್ಮೆನಿಯ0', 'XENON\nಕ್ಷೇನನ್', 'A', 1, ''),
('delicate-spider', '58', 'THE MASS RATIO OF NITROGEN AND HYDROGEN IN AMMONIA IS\nಅಮೋನಿಯದಲ್ಲಿ ನೈಟ್ರೋಜನ್ ಮತ್ತು ಹೈಡ್ರೋಜನ್ ಗಳ ರಾಶಿಯ ಅನುಪಾತ', '3:14\n', '14:3', '1:3\n', '3:1\n', 'B', 1, ''),
('delicate-spider', '59', 'ATOMIC MASS OF SODIUM IS 26g/mol. NUMBER OF MOLES OF SODIUM PRESENT IN  46g OF SODIUM IS\nಸೋಡಿಯಂ ಪರಮಾಣು ರಾಶಿ 23, 46 ಗ್ರಾಮ ಸೋಡಿಯಂನಲ್ಲಿರುವ ಮೋ ಲ್ ಗಳ  ಸಂಖ್ಯೆ', '4', '2', '0', '0.5', 'B', 1, ''),
('delicate-spider', '60', 'WHAT IS THE FUNCTIONAL GROUP PRESENT IN BUTANOL?\nಬ್ಯುಟನಾಲ್ ನಲ್ಲಿರುವ ಕ್ರಿಯಾತ್ಮಕ ಗುಂಪು ಯಾವುದು?', 'CARBOXYLIC ACID. \nಕಾರ್ಬಾಕ್ಸಿಲಿಕ್ ಆಮ್ಲ ', 'ALDEHYDE\nಆಲ್ಡಿಹೈಡ್.', 'KETONE.\nಕೀಟೋನ್', 'ALCOHOL.\nಮದ್ಯ.', 'D', 1, ''),
('delicate-spider', '61', '25 PEOPLE CAN DO A PIECE OF WORK IN 40 DAYS, THEN THE TIME TAKEN BY 20 PEOPLE TO DO THE SAME WORK IS.\n25 ಜನರು 40 ದಿನಗಳಲ್ಲಿ ಒಂದು ಕೆಲಸವನ್ನು ಮಾಡಬಹುದು, ನಂತರ ಅದೇ ಕೆಲಸವನ್ನು ಮಾಡಲು 20 ಜನರು ತೆಗೆದುಕೊಳ್ಳುವ ಸಮಯ.', '15 DAYS |', '16 DAYS', '12 DAYS', '50 DAYS', 'D', 1, ''),
('delicate-spider', '62', 'THE TERM THAT SHOULD BE ADDED TO  4x^2+12xy TO MAKE IT A PERFECT SQUARE IS		\nಇದನ್ನು ಪರಿಪೂರ್ಣ ಚೌಕವನ್ನಾಗಿ ಮಾಡಲು 4x^2+12xy ಗೆ ಸೇರಿಸಬೇಕಾದ ಪದ.', '9Y', '9XY', '9y^2', '4y^2', 'C', 1, ''),
('delicate-spider', '63', 'WHEN THE POLYNOMIAL 3x^4+4x^3+4x1 IS DIVIDED BY (X+1), THEN THE REMAINDER IS		\nಬಹುಪದೋಕ್ತಿ 3x^4+4x^3+4x1  ಅನ್ನು (X+1) ರಿಂದ ಭಾಗಿಸಿದಾಗ ಜ್ಞಾಪನೆ.', '6', '5', '-5', '-6', 'D', 1, ''),
('delicate-spider', '64', 'THE DISTANCE BETWEEN TWO POINTS A(3,2) AND B(X,6) IS 5UNITS,THEN THE VALUE OF X IS \nA(3, 2) ಮತ್ತು  B(X,6) ಎರಡು ಬಿಂದುಗಳ ನಡುವಿನ ಅಂತರವು 5 ಘಟಕಗಳು ಆಗಿದ್ದರೆ X ನ ಮೌಲ್ಯ', '-3', '-2	', '6', '5', 'C', 1, ''),
('delicate-spider', '65', 'THE AREA OF AN EQUILATERAL TRIANGLE IS 25SQ.CM,THEN ITS PERIMETER IS \nಸಮಬಾಹು ತ್ರಿಕೋನದ ವಿಸ್ತೀರ್ಣ  25ಚದರ ಸೆಂಟಿಮೀಟರ್ ಆಗಿದ್ದರೆ ಅದರ ಪರಿಧಿ		', '10CM', '20CM	', '30CM	', '40CM.', 'C', 1, ''),
('delicate-spider', '66', 'A BOX CONTAINS 12 MARBLES OF WHICH 3 ARE BLUE,4 ARE WHITE AND REMAINING MARBLES ARE RED.A MARBLE IS DRAWN AT RANDOM FROM THE BOX ,THEN THE PROBABILITY THAT THE MARBLE IS RED ,WILL BE\nಪೆಟ್ಟಿಗೆಯು 12 ಮಾರ್ಬಲ್‌ಗಳನ್ನು ಹೊಂದಿರುತ್ತದೆ ಅದರಲ್ಲಿ 3 ನೀಲಿ, 4 ಬಿಳಿ ಮತ್ತು ಉಳಿದ ಮಾರ್ಬಲ್‌ಗಳು ಕೆಂಪು. ಪೆಟ್ಟಿಗೆಯಿಂದ ಯಾದೃಚ್ಛಿಕವಾಗಿ ಮಾರ್ಬಲ್‌ಗಳನ್ನು ಎಳೆಯಲಾಗುತ್ತದೆ, ಆಗ ಮಾರ್ಬಲ್ ಕೆಂಪು ಆಗಿರುವ ಸಂಭವನೀಯತೆ ಹೇಗಿರುತ್ತದೆ?', '', '	', '	', '\n', 'B', 1, ''),
('delicate-spider', '67', 'IF SEC2A=COSEC(A-29),WHERE 2A IS AN ACUTE ANGLE ,FIND THE MEASURE OF ANGLE A. \nsec2A =cosec(A-29°), ಅಲ್ಲಿ 2A ಒಂದು ತೀವ್ರ ಕೋನವಾಗಿದ್ದರೆ A ಕೋನದ ಅಳತೆಯನ್ನು ಕಂಡುಹಿಡಿಯಿರಿ.', '117', '39', '29', '2A\n', 'B', 1, ''),
('delicate-spider', '68', 'IF SEC X + TAN X = 7,THEN EVALUATE SEC X – TAN X,		\nSEC X + TAN X = 7ಆಗಿದ್ದರೆ, SEC X – TAN X ಅನ್ನು ಮೌಲ್ಯಮಾಪನ ಮಾಡಿ	', '7', '-7', '1', '', 'D', 1, ''),
('delicate-spider', '69', 'HOW MANY TWO DIGITS NUMBERS ARE DIVISIBLE BY 3?\nಎಷ್ಟು ಎರಡು ಅಂಕೆಗಳ ಸಂಖ್ಯೆಗಳನ್ನು 3 ರಿಂದ ಭಾಗಿಸಬಹುದು				\n', '12', '28', '30', '3', 'C', 1, ''),
('delicate-spider', '70', 'IF RADII OF TWO CONCENTRIC CIRCLES ARE 4 CM AND 5 CM ,THEN THE LENGTH OF EACH CHORD OF ONE CIRCLE WHICH IS TANGENT TO THE OTHER CIRCLE IS ?	\nಎರಡು ಏಕಕೇಂದ್ರಕ ವೃತ್ತಗಳ ತ್ರಿಜ್ಯವು 4 cm ಮತ್ತು 5 cm ಆಗಿದ್ದರೆ, ಇನ್ನೊಂದು ವೃತ್ತಕ್ಕೆ ಸ್ಪರ್ಶಿಸುವ ಒಂದು ವೃತ್ತದ ಪ್ರತಿಯೊಂದು ಸ್ವರಮೇಳದ ಉದ್ದ ಎಷ್ಟು?', '3CM', '6CM	', '9CM	', '1CM', 'B', 1, ''),
