('didactic-mongrel', '60', 'WHAT IS THE FUNCTIONAL GROUP PRESENT IN BUTANOL?\nಬ್ಯುಟನಾಲ್ ನಲ್ಲಿರುವ ಕ್ರಿಯಾತ್ಮಕ ಗುಂಪು ಯಾವುದು?', 'CARBOXYLIC ACID. \nಕಾರ್ಬಾಕ್ಸಿಲಿಕ್ ಆಮ್ಲ ', 'ALDEHYDE\nಆಲ್ಡಿಹೈಡ್.', 'KETONE.\nಕೀಟೋನ್', 'ALCOHOL.\nಮದ್ಯ.', 'D', 1, ''),
('didactic-mongrel', '61', '25 PEOPLE CAN DO A PIECE OF WORK IN 40 DAYS, THEN THE TIME TAKEN BY 20 PEOPLE TO DO THE SAME WORK IS.\n25 ಜನರು 40 ದಿನಗಳಲ್ಲಿ ಒಂದು ಕೆಲಸವನ್ನು ಮಾಡಬಹುದು, ನಂತರ ಅದೇ ಕೆಲಸವನ್ನು ಮಾಡಲು 20 ಜನರು ತೆಗೆದುಕೊಳ್ಳುವ ಸಮಯ.', '15 DAYS |', '16 DAYS', '12 DAYS', '50 DAYS', 'D', 1, ''),
