('didactic-mongrel', '66', 'A BOX CONTAINS 12 MARBLES OF WHICH 3 ARE BLUE,4 ARE WHITE AND REMAINING MARBLES ARE RED.A MARBLE IS DRAWN AT RANDOM FROM THE BOX ,THEN THE PROBABILITY THAT THE MARBLE IS RED ,WILL BE\nಪೆಟ್ಟಿಗೆಯು 12 ಮಾರ್ಬಲ್‌ಗಳನ್ನು ಹೊಂದಿರುತ್ತದೆ ಅದರಲ್ಲಿ 3 ನೀಲಿ, 4 ಬಿಳಿ ಮತ್ತು ಉಳಿದ ಮಾರ್ಬಲ್‌ಗಳು ಕೆಂಪು. ಪೆಟ್ಟಿಗೆಯಿಂದ ಯಾದೃಚ್ಛಿಕವಾಗಿ ಮಾರ್ಬಲ್‌ಗಳನ್ನು ಎಳೆಯಲಾಗುತ್ತದೆ, ಆಗ ಮಾರ್ಬಲ್ ಕೆಂಪು ಆಗಿರುವ ಸಂಭವನೀಯತೆ ಹೇಗಿರುತ್ತದೆ?', '', '	', '	', '\n', 'B', 1, ''),
