('courageous-trogon', '56', 'CHOOSE THE CORRECT STATEMENT ABOUT ACIDS AND BASES\nದ್ರವನದ ಆಮ್ಲಿಯತೆ ಮತ್ತು ಪ್ರತ್ಯಾಮ್ಲಿಯತೆಗೆ ಸಂಬಂಧಿಸಿದಂತೆ ಈ ಕೆಳಗಿನವುಗಳಲ್ಲಿ ಸರಿಯಾದ ಹೇಳಿಕೆ\nA.  HIGHER THE PH, STRONGER THE ACID (ಹೆಚ್ಚಿನ PH, ಸಾರಯುತ ಅಮ್ಲ)\nB. HIGHER THE PH, WEAKER THE ACID (ಹೆಚ್ಚಿನ PH, ಸಾರರಿಕ್ತ ಅಮ್ಲ)\nC. LOWER THE PH WEAKER THE BASE (ಕಡಿಮೆ PH, ಸರರಿಕ್ತ ಪ್ರತ್ಯಾಮ್ಲ)\nD. LOWER THE PH STRONGER THE BASE (ಕಡಿಮೆ PH, ಸಾರಯುತ ಪ್ರತ್ಯಾಮ್ಲ)', '(A) & (B)', '(B) & (C)', '(A) & (C)', '(B) & (C)', 'B', 1, ''),
