('invaluable-swan', '61', '25 PEOPLE CAN DO A PIECE OF WORK IN 40 DAYS, THEN THE TIME TAKEN BY 20 PEOPLE TO DO THE SAME WORK IS.\n25 ಜನರು 40 ದಿನಗಳಲ್ಲಿ ಒಂದು ಕೆಲಸವನ್ನು ಮಾಡಬಹುದು, ನಂತರ ಅದೇ ಕೆಲಸವನ್ನು ಮಾಡಲು 20 ಜನರು ತೆಗೆದುಕೊಳ್ಳುವ ಸಮಯ.', '15 DAYS |', '16 DAYS', '12 DAYS', '50 DAYS', 'D', 1, ''),
('invaluable-swan', '62', 'THE TERM THAT SHOULD BE ADDED TO  4x^2+12xy TO MAKE IT A PERFECT SQUARE IS		\nಇದನ್ನು ಪರಿಪೂರ್ಣ ಚೌಕವನ್ನಾಗಿ ಮಾಡಲು 4x^2+12xy ಗೆ ಸೇರಿಸಬೇಕಾದ ಪದ.', '9Y', '9XY', '9y^2', '4y^2', 'C', 1, ''),
