('ajmains-hin', '53', 'THE COMPONENT OF FOOD THAT DOES NOT PROVIDE ANY NUTRIENT TO OUR BODY AND YET IS ESSENTIAL IN OUR FOOD IS\nನಮ್ಮ ದೇಹಕ್ಕೆ ಯಾವುದೇ ಪೋಷಕಾಂಶವನ್ನು ಒದಗಿಸದ  ಆಹಾರದ ಈ ಅಂಶವು ನಮ್ಮ ಆಹಾರದಲ್ಲಿ ಅತ್ಯಗತ್ಯವಾಗಿರುತ್ತದೆ', 'FAT\nಕೊಬ್ಬು', 'CARBOHYDRATE\nಶರ್ಕರಪಿಷ್ಟಗಳು', 'VITAMIN\nವಿಟಮಿನ್', 'ROUGHAGE\nನಾರಿನಂಶ', 'D', 1, ''),
