('ajmains-hin', '72', '\"NARMADA BACHAVO\" MOVEMENT IS LED BY\n\"ನರ್ಮದಾ ಬಚಾವೋ \' ಅಂದೋಲನದ ನೇತೃತ್ವ ವಹಿಸಿದವರು', ' SUNDARLAL BAHUGUNA.              \n ಸುಂದರ್ ಲಾಲ್ ಬಹುಗುಣ         ', 'SHIVARAMA KARANTA\nಶಿವರಾಮ ಕಾರಂತ', 'MEDHA PATKAR        \nಮೇಧಾ ಪಾಟ್ಕರ್                                             ', 'BABA AMTE          \nಬಾಬಾ ಆಮ್ಟೆ                        ', 'C', 1, ''),
('ajmains-hin', '73', 'RBI GOVERNOR OF INDIA.\nಭಾರತದ RBI ಗವರ್ನರ್.', 'D. SUBBA RAO      \nಡಿ. ಸುಬ್ಬಾ ರಾವ್\n', 'RAGHURAM RAJAN\nರಘುರಾಮ್ ರಾಜನ್\n', 'SHAKTHIKANT DAS    \nಶಕ್ತಿಕಾಂತ್ ದಾಸ್ \n', 'URJIT RAVINDRA PATEL\nಉರ್ಜಿತ್ ರವೀಂದ್ರ ಪಟೇಲ್\n', 'C', 1, ''),
('ajmains-hin', '74', '1, 6, 15,  ?,  45, 66, 91', '25', '26', '27', '28\n', 'D', 1, ''),
('ajmains-hin', '75', 'ATB = 23, GKC = 21, JQV = ?\n', '38', '49   ', '44  ', '51', 'B', 1, ''),
('ajmains-hin', '76', 'WHO IS THE FINANCE MINISTER OF KARNATAKA? \nಕರ್ನಾಟಕದ ಹಣಕಾಸು ಸಚಿವರು ಯಾರು?', 'PANKAJ CHUDRI            \nಪಂಕಜ್ ಚೌಧರಿ                    ', 'NIRMALA SITHARAMAN\nನಿರ್ಮಲಾ ಸೀತಾರಾಮನ್.  \n', 'BASAVARAJ BOMMAI\nಬಸವರಾಜು ಬೊಮ್ಮಾಯಿ        ', 'CHIDAMBARAM\nಚಿದಂಬರಂ', 'C', 1, ''),
('ajmains-hin', '77', 'WHICH STATE LAUNCHED ‘PROJECT SADBHAWANA’ TO IMPROVE GOVERNANCE?\nಯಾವ ರಾಜ್ಯವು ಆಡಳಿತವನ್ನು ಸುಧಾರಿಸಲು \'ಪ್ರಾಜೆಕ್ಟ್ ಸದ್ಭಾವನಾ\'ವನ್ನು ಪ್ರಾರಂಭಿಸಿತು?', 'NEW DELHI\nನವದೆಹಲಿ', 'MADHYA PRADESH\nಮಧ್ಯಪ್ರದೇಶ', 'ASSAM\nಅಸ್ಸಾಂ', 'ODISHA\nಒಡಿಶಾ', 'C', 1, ''),
('ajmains-hin', '78', 'WHICH IS THE CAPITAL OF ODISHA?\nಒಡಿಶಾದ ರಾಜಧಾನಿ ಯಾವುದು', 'CUTTACK\nಕಟಕ್', 'BHUBANESHWAR\nಭುವನೇಶ್ವರ', 'MAYURBHANJ\nಮಯೂರ್ಭಂಜ್', 'NONE OF THESE\nಇವುಗಳಲ್ಲಿ ಯಾವುದೂ ಇಲ್ಲ', 'B', 1, ''),
('ajmains-hin', '79', 'WHICH OF THESE IS NOT AN INPUT DEVICE?\nಇವುಗಳಲ್ಲಿ ಯಾವುದು ಇನ್‌ಪುಟ್ ಸಾಧನವಲ್ಲ?', 'WEB CAMERA\nವೆಬ್ ಕ್ಯಾಮೆರಾ', 'MOUSE\nಮೌಸ್\n', 'PRINTER\nಪ್ರಿಂಟರ್\n', 'KEYBOARD\nಕೀಬೋರ್ಡ್\n', 'C', 1, ''),
('ajmains-hin', '80', 'THE PHYSICAL DEVICES AND CIRCUITRY OF A COMPUTER ARE CALLED AS?\nಕಂಪ್ಯೂಟರ್‌ನ ಭೌತಿಕ ಸಾಧನಗಳು ಮತ್ತು ಸರ್ಕ್ಯೂಟ್‌ಗಳನ್ನು ಹೀಗೆ ಕರೆಯುತ್ತಾರೆ?\n', 'HARDWARE\nಹಾರ್ಡ್‌ವೇರ್\n', 'SOFTWARE\nಸಾಫ್ಟ್‌ವೇರ್\n', 'DEVICES\nಸಾಧನಗಳು\n', 'NONE OF THESE\nಇವುಗಳಲ್ಲಿ ಯಾವುದೂ ಇಲ್ಲ\n', 'A', 1, '');
